import Carousel from "react-bootstrap/Carousel";
import styled from "styled-components";

const StyledPicture = styled.div`
  width: 400px;
  height: 400px;
  background-color: black;
  display: flex;
  justify-content: center;
  align-items: center;
  color: white;
  font-size: 24px;
  font-weight: bold;
  text-align: center;
`;

const StyledDiv = styled.div`
  height: 30rem;
  width: auto;
  background-color: #edcac4;
`;

const StyledItem = styled(Carousel.Item)`
  display: flex;
  justify-content: center;
  align-items: center;

  & img {
    width: auto;
    max-height: 100%;
  }
`;

function HomePage() {
  return (
    <StyledDiv>
      <Carousel>
        <StyledItem>
          <StyledPicture>first</StyledPicture>
          <Carousel.Caption>
            <h3>First Slide</h3>
            <p>This is the caption for the first slide.</p>
          </Carousel.Caption>
        </StyledItem>
        <StyledItem>
          <StyledPicture>second</StyledPicture>

          <Carousel.Caption>
            <h3>Second Slide</h3>
            <p>This is the caption for the second slide.</p>
          </Carousel.Caption>
        </StyledItem>
        <StyledItem>
          <StyledPicture>third</StyledPicture>

          <Carousel.Caption>
            <h3>Third Slide</h3>
            <p>This is the caption for the third slide.</p>
          </Carousel.Caption>
        </StyledItem>
      </Carousel>
    </StyledDiv>
  );
}

export default HomePage;
